import React from "react";
import styled from "styled-components";

const TodoInsertModal = () => {
  return;
  <TodoInsertWrapper>
    <TodoInsertTitle />
    <TodoInsertBody />
    <TodoInsertButton />
  </TodoInsertWrapper>;
};

export default TodoInsertModal;

const TodoInsertWrapper = styled.div`
  width: 1024px;
  height: 800px;
`;
